{'message': '喵哥请用靴子尖来戳我(〜￣△￣)〜

说出来实在是太痴汉了，这几天在每次坐地铁时就找个没人的小角落，把up的这个MMD撸了一遍又一遍啊啊啊。。已经到了不带耳机都可以准确配乐的节奏_(:3」∠)_感觉被卖安利了啊，虽然之前一直玩的喵姐，但玩基三也只是随便混混日子而已，看了MMD以后整个人都对喵哥整没话说了啊满腔痴汉的心情都膨胀起来了( ´_ゝ｀)试图再找一些类似的MMD吃个撑但都不太对胃口，镜头感略差最重要的是不戴帽子的喵哥才是真绝色啊明明！！于是每天疲惫了就无限LOOP，这种愉悦又撒鼻息撸视频的心情啊

怎样表达我对这个MMD的喜爱呢。。如果可以的话，请up再多多的做一些福利出来吧(´；ω；`)up真棒！', 'plat': 0, 'device': ''}

