{'message': '提前说一下，我意料到的未来：打算玩电波女线的狂喜大骂为什么这个游戏一周目只能推幼驯染啊，固定路线太坑了啊。打算玩幼驯染线的狂喜说挺不错的游戏啊，虽然中途有种主角要被NTR的不好感觉。但是还是happy end了。可以转战其他游戏了。

3、打算玩黑历史线的狂喜被毁了三观：那个推荐我玩这个游戏的人，小心某天被我捅爆ta菊花(╯°口°)╯(┴—┴

结论：好奇心杀死猫，贪心没好事，专门玩玩家的游戏', 'plat': 0, 'device': ''}

{'message': '霰触之前在评论和贴吧里，大肆指责恶俗素材，直呼这些HOMO物非常恶心和低俗，破坏音MAD圈。
如果按照霰触之前的说法，UP主你这个作品是低俗恶心的。恶心的东西&quot;撑死也只值那三位数的点击量&quot;。

那时我还真以为他是坚决反对恶俗的领军者，结果到头来他自己一转身又对美国的G V素材津津乐道，&quot;基♂个♂痛♂快&quot;。我仔细一看，他自己还曾经拿这些美国G V来做过作品。原来G V的口味在他心里是分等级的，他喜欢的美国口味就不算低俗恶俗了。到头来，之前那些义正言辞的言论全特么是骗人的。', 'plat': 0, 'device': ''}
